import React, { useState } from "react";
import "../components/homepage.scoped.css";

function Homepage() {
  const [fetchApi, setFetchApi] = useState([
    {
      activity: "Henna",
      id: 2,
      name: "Ekta Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Nails & Manicure",
      id: 3,
      name: "Ekta Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Diya Painting",
      id: 4,
      name: "Ekta Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Art & Craft",
      id: 5,
      name: "Ekta Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Face Painting",
      id: 6,
      name: "Ekta Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Art & Craft",
      id: 7,
      name: "Anmol Gupta",
      number: "+16476365383",
      status: "waiting",
    },
    {
      activity: "Nails",
      id: 8,
      name: "Shama Gupta",
      number: "+16479497857",
      status: "waiting",
    },
    {
      activity: "Manicure",
      id: 9,
      name: "Shama Gupta",
      number: "+16479497857",
      status: "waiting",
    },
  ]);

  const henna= fetchApi.map((data) => {
    return (
      <div>
        {data.activity == "Henna" ? (
          <div className="checkbox">
            <div>
              <label>
                <input type="checkbox" name="" id="" />
                {data.name}
              </label>
            </div>
            <div>
              <button>Whatsapp</button>
            </div>
          </div>
        ) : 
          ""
        }
      </div>
    );
  })
  return (
    <div className="main-div">
      <div className="sub-div">
        <div className="sub-sub-div henna">
          <div className="heading">Henna</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Henna" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : 
                  ""
                }
              </div>
            );
          })}
        </div>
        <div className="sub-sub-div manicure">
          {" "}
          <div className="heading">Manicure</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Manicure" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : (
                  ""
                )}
              </div>
            );
          })}
        </div>
        <div className="sub-sub-div art">
          {" "}
          <div className="heading">Art & Craft Workshop</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Art & Craft" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : (
                  ""
                )}
              </div>
            );
          })}
        </div>
        <div className="sub-sub-div facepainting">
          {" "}
          <div className="heading">Face Painting</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Face Painting" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : (
                  ""
                )}
              </div>
            );
          })}
        </div>
      </div>
      <div className="sub-div">
        <div className="sub-sub-div nailart">
          {" "}
          <div className="heading">Nail Art</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Nails" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : (
                  ""
                )}
              </div>
            );
          })}
        </div>
        <div className="sub-sub-div diyapainting">
          {" "}
          <div className="heading">Diya Painting Workshop</div>
          {fetchApi.map((data) => {
            return (
              <div>
                {data.activity == "Diya Painting" ? (
                  <div className="checkbox">
                    <div>
                      <label>
                        <input type="checkbox" name="" id="" />
                        {data.name}
                      </label>
                    </div>
                    <div>
                      <button>Whatsapp</button>
                    </div>
                  </div>
                ) : (
                  ""
                )}
              </div>
            );
          })}
        </div>
      </div>
    </div>
  );
}

export default Homepage;
